import React from 'react'

const Home = () => {
    return (
        <div className="mb-20">
            <h1 className="sm:text-4xl text-2xl font-bold mt-6 text-gray-900">Hello peeps!</h1>
            <p className="mx-auto leading-relaxed text-base mb-4">Welcome to my blog!!</p>
            <p className="mx-auto leading-relaxed text-base mb-4">Are you a cowirgin?</p>
        </div>
    )
}

export default Home
